import React from 'react';

const About = () => {
  return (
    <div style={{ backgroundColor: '#4a148c', height: '100vh', color: 'white', padding: '20px', textAlign: 'center' }}>
      <h1 style={{ fontSize: '36px', marginBottom: '10px' }}>About Us</h1>
      <p style={{ fontSize: '18px', marginBottom: '20px' }}>
        This application demonstrates how to integrate Coralogix with a React frontend application.
      </p>
      <p style={{ fontSize: '18px', marginBottom: '20px' }}>
        It includes multiple pages and generates errors to be logged and monitored on the Coralogix platform.
      </p>
      <Link to="/">
        <button
          style={{
            padding: '15px 30px',
            fontSize: '18px',
            backgroundColor: '#9c27b0',
            color: 'white',
            border: 'none',
            borderRadius: '5px',
            cursor: 'pointer',
            transition: 'background-color 0.3s',
          }}
          onMouseOver={(e) => e.currentTarget.style.backgroundColor = '#7b1fa2'}
          onMouseOut={(e) => e.currentTarget.style.backgroundColor = '#9c27b0'}
        >
          Go Back Home
        </button>
      </Link>
    </div>
  );
};

export default About;
